import React, { Component } from 'react';


class Create extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <>
                <div class="container">
                    <div class="row">
                        hello
                    </div>
                </div>
            </>
        );
    }
}

export default Create;
